import React from "react";
import { Table } from "react-bootstrap";

function Tabla(props) {
  
  return (
    <Table className="table-responsive">
      <thead>
        {props.columnas}
      </thead>

      <tbody>
       {props.informacion.map(props.funcion)}
      </tbody>
    </Table>
  );
}

export default Tabla;
